import Auth from "@/models/Auth";
import axios from "axios";

export default (to, from, next) => {
  let isLogged = false;

  axios.get('validate-token').then(response => {
    console.log(response.status);
  })

  if (isLogged) {
    next();
  } else {
    next({ name: 'login' })
  }

  /*
  if( !Auth.check() ) {
    next({ name: 'login' });
  }
  */
}
